import React from 'react'
import Navbar from "./navbar";
import Header from './Header';
import HowItWorks from './HowItWorks';
import Aboutus from "./components/Aboutus";
import Services from "./components/Services"

const App = () => {
  return (
    <>
    <Navbar />
    <Header />
    <HowItWorks />
    <Aboutus />
    <Services />
    </>
  ); 
};

export default App;
